import React from "react";
// import { NavLink } from "react-router-dom";
import s from "./Dialogs.module.css";
import DialogItem from './DialogItem/DialogItem.jsx';
import Massage from './Massage/Massage.jsx';

const Dialogs = (props) => {

  // let dialogs = [ 
  //   {id: 1, name:'Viktor'}, 
  //   {id: 2, name:'July'}, 
  //   {id: 3, name:'Kate'}, 
  //   {id: 4, name:'Nasty'}, 
  //   {id: 5, name:'Irina'} 
  // ]

  // let massages = [ 
  //   {id: 1, massage:"Hi! What's up?"}, 
  //   {id: 2, massage:"Great"}, 
  //   {id: 3, massage:"Yo"}, 
  //   {id: 4, massage:"Yo"}
  // ]

  let dialogsElements = this.props.dialogs.map ( dialog => <DialogItem name = {this.props.dialog.name} id = {this.props.dialog.id} />);
  let massageElements = this.props.massages.map ( massage => <Massage massage = {this.props.massage.massage} />);

  return (
    <div className={s.dialogs}>
      <div className={s.dialogsItems}>
        {dialogsElements}
      </div>
      <div className={s.massages}>
        {massageElements}
      </div>
    </div>
  )
};

export default Dialogs;
